<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
    <style type="text/css">
        .box {
            width: 320px;
            height: 250px;
            box-sizing: border-box;
        }

        a {
            text-decoration: none;
        }


        .content{
            width: 320px;
            height: 250px;
            display: flex;
        }

        .content__description{
            width: 130px;
            height: 250px;
            background: rgba(47, 50, 46, 1);
            display: flex;
            flex-direction: column;
            align-items: center;
        }

        .content__description-logo{
            width: 78px;
            height: 65px;
            margin-top: 32px;
        }
        
        .content__description-logo img{
            width: 100%;
            height: 100%;
            object-fit: cover;
        }

        .content__description-title{
            text-align: center;
            width: 100px;
            color: white;
            margin: 0;
            margin-top: 14px;
            font-family: "Minion Pro";
            font-size: 16px;
            font-weight: 400;
        }

        .content__description-subtitle{
            margin: 0;
            font-size: 8px;
            color: white;
            font-family: "Proxima Nova Rg";
            letter-spacing: 0.213333px;
            font-weight: 400;

        }
       

        .content__image{
            width: 190px;
            height: 250px;
        }

        .content__image img{
            width: 100%;
            height: 100%;
            object-fit: cover;
        }

        .content__button{
            width: 100px;
            height: 18px;
            font-size: 8px;
            border: 0.5px solid #FFFFFF;
            text-align: center;
            padding-top: 3px;
            box-sizing: border-box;
            color: white;
            margin-top: 21px;
            font-family: "Proxima Nova Rg";
            letter-spacing: 0.168421px;
        }

        .footer{
            width: 320px;
            height: 25px;
            background: #123C48;
            display: flex;
            justify-content: space-between;
            align-items: center;
            padding-left: 16px;
            padding-right: 16px;
            box-sizing: border-box;
        }

        .footer__image-1{
            width: 51px;
            height: 16px;
        }

        .footer__image-2{
            width: 83px;
            height: 15px;
        }

        .footer__image-1 img,
        .footer__image-2 img{
            width: 100%;
            height: 100%;
            object-fit: cover;
        }
